import "./App.css";
import Header from "./Components/Header";
import Home from "./pages/Home";
import { Route, Switch, Router } from "react-router-dom";
function App() {
  return (
    <Router>
      <Header></Header>
      <Switch>
        <Route path="./" exact Component={Home} />
      </Switch>
      <Home> </Home>
      <div>Footer</div>
    </Router>
  );
}

export default App;
